import React, { Component } from "react";
import Link from "next/link";

class App extends Component {
  state = {};
  render() {
    return (
      <div>
        <container>
          <Link href="/" as={`/`}>
            <button className="absolute top-0 left-0 m-4 px-3 bg-gray-400 opacity-50 hover:opacity-75 rounded-full border-black border">
              back
            </button>
          </Link>

          <img
            src="/img/projectPictures/soloStander/landing.png"
            alt="solo stander"
          />
        </container>
        <div className="container">
          <div>
            <h1>Background:</h1>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
